import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';

const PageOne = () => {
  return <div>PageOne</div>
}

const PageTwo = () => {
  return <div>PageTwo</div>
}

const App = () => {
  return (
    <div>
      <BrowserRouter>
        {/* default: contains */}
        <Route path="/" exact component={PageOne} />
        <Route path="/page/two" component={PageTwo} />
      </BrowserRouter>
    </div>
  )
}

export default App;
